// import logo from "./logo.svg";
import "./App.css";
import { Navbar } from "./components/Landing/Navbar";
import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { Route, Routes } from "react-router-dom";
import { StoreData } from "./Redux/Action/action";
import { useSelector } from "react-redux";
import { Head } from "./components/Landing/Head";
import { ShowProduct } from "./components/Landing/ShowProduct";
import { Carosel } from "./components/Landing/Carosel";

function App() {
  const dispatch = useDispatch();
  useEffect(() => {
    fetch("http://localhost:3002/productdata")
      .then((res) => res.json())
      .then((res) => dispatch(StoreData(res)))
      .catch((err) => console.log(err));
  }, []);
  const x = useSelector((state) => state.data);
  console.log(x);
  return (
    <div className="App">
      <Navbar />
      <Head />
      <Carosel />
      {/* <ShowProduct /> */}
      <Routes>
        <Route path="/ShowProduct" element={<ShowProduct />}></Route>
        <Route path="/"></Route>
        <Route path="/"></Route>
      </Routes>
    </div>
  );
}

export default App;
